  `add_time` int(11) NOT NULL COMMENT '添加时间',
  `desc` varchar(2000) NOT NULL COMMENT '描述',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='店铺消费者保障服务保证金日志表';


-- -----------------------------
-- Table structure for `tp_guarantee_item`
-- -----------------------------
DROP TABLE IF EXISTS `tp_guarantee_item`;
CREATE TABLE `tp_guarantee_item` (
  `grt_id` int(11) NOT NULL AUTO_INCREMENT COMMENT '自增ID',
  `grt_name` varchar(100) NOT NULL COMMENT '保障项目名称',
  `grt_describe` varchar(2000) NOT NULL COMMENT '保障项目描述',
  `grt_cost` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '保证金',
  `grt_icon` varchar(500) NOT NULL COMMENT '图标',
