  `grt_score` int(10) DEFAULT '0' COMMENT '扣除分数',
  PRIMARY KEY (`grt_id`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8 COMMENT='消费者保障服务项目表';


-- -----------------------------
-- Table structure for `tp_guarantee_log`
-- -----------------------------
DROP TABLE IF EXISTS `tp_guarantee_log`;
CREATE TABLE `tp_guarantee_log` (
  `log_id` int(11) NOT NULL AUTO_INCREMENT COMMENT '自增ID',
  `log_storeid` int(11) NOT NULL COMMENT '店铺ID',
  `log_storename` varchar(500) NOT NULL COMMENT '店铺名称',
  `log_grtid` int(11) NOT NULL COMMENT '服务项目ID',
  `log_grtname` varchar(100) NOT NULL COMMENT '服务项目名称',
  `log_msg` varchar(1000) NOT NULL COMMENT '操作描述',
