-- -----------------------------
-- Table structure for `tp_spec`
-- -----------------------------
DROP TABLE IF EXISTS `tp_spec`;
CREATE TABLE `tp_spec` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '规格表',
  `name` varchar(55) DEFAULT NULL COMMENT '规格名称',
  `order` int(11) DEFAULT '50' COMMENT '排序',
  `is_upload_image` tinyint(1) NOT NULL DEFAULT '0' COMMENT '是否可上传规格图:0不可，1可以',
  `search_index` tinyint(1) DEFAULT '0' COMMENT '是否需要检索',
  `cat_id1` int(11) DEFAULT '0' COMMENT '一级分类',
  `cat_id2` int(11) DEFAULT '0' COMMENT '二级分类',
  `cat_id3` int(11) DEFAULT '0' COMMENT '三级分类',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=utf8;

-- -----------------------------
-- Records of `tp_spec`
-- -----------------------------

-- -----------------------------
-- Table structure for `tp_spec_goods_price`
-- -----------------------------
DROP TABLE IF EXISTS `tp_spec_goods_price`;
CREATE TABLE `tp_spec_goods_price` (
  `item_id` bigint(20) unsigned NOT NULL AUTO_INCREMENT COMMENT '规格商品id',
  `goods_id` int(11) NOT NULL DEFAULT '0' COMMENT '商品id',
  `goods_mark` varchar(255) NOT NULL DEFAULT '' COMMENT '商品规格备注',
  `key` varchar(255) CHARACTER SET utf8 COLLATE utf8_bin NOT NULL DEFAULT '' COMMENT '规格键名',
  `key_name` varchar(255) CHARACTER SET utf8 COLLATE utf8_bin NOT NULL DEFAULT '' COMMENT '规格键名中文',
  `price` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '价格',
  `store_count` int(11) unsigned NOT NULL DEFAULT '10' COMMENT '库存数量',
  `bar_code` varchar(32) CHARACTER SET utf8 COLLATE utf8_bin NOT NULL DEFAULT '' COMMENT '商品条形码',
  `sku` varchar(128) CHARACTER SET utf8 COLLATE utf8_bin NOT NULL DEFAULT '' COMMENT 'SKU',
  `store_id` int(11) NOT NULL DEFAULT '0' COMMENT '店铺商家id',
  `spec_img` varchar(255) NOT NULL DEFAULT '' COMMENT '规格商品主图',
  `prom_id` int(10) NOT NULL DEFAULT '0' COMMENT '参加活动id',
  `prom_type` tinyint(2) NOT NULL DEFAULT '0' COMMENT '参加活动类型',
  `cost` decimal(10,2) DEFAULT NULL COMMENT '成本价',
  `root_item_id` bigint(20) NOT NULL DEFAULT '0' COMMENT '根item_id（供应商复制规格寻根）',
  PRIMARY KEY (`item_id`),
  KEY `gk` (`goods_id`,`key`) USING BTREE,
  KEY `goods_id` (`goods_id`) USING BTREE,
  KEY `store_id` (`store_id`) USING BTREE,
  KEY `key` (`key`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8;


-- -----------------------------
-- Table structure for `tp_spec_image`
-- -----------------------------
DROP TABLE IF EXISTS `tp_spec_image`;
CREATE TABLE `tp_spec_image` (
  `goods_id` int(11) DEFAULT '0' COMMENT '商品规格图片表id',
